import React from "react";
import {Container, Typography, Box, Grid, Paper} from "@material-ui/core";
import {makeStyles, withStyles} from "@material-ui/core/styles";
import SvgIcon from "@material-ui/core/SvgIcon";
import Button from "@material-ui/core/Button";
import {maxWidth} from "@material-ui/system";

function HeaderIcon(props) {
    return (
        <SvgIcon fill="none" {...props}>
            <path d="M11.2713 6.61768L9.71289 8.17282L14.775 13.2353L9.71289 18.2978L11.2713 19.853L17.9029 13.2353L11.2713 6.61768Z" />
            <path d="M10.59 10.4227L9.72425 9.55878L6.04004 13.2352L9.72425 16.9117L10.59 16.0477L7.77776 13.2352L10.59 10.4227Z" />
        </SvgIcon>
    )
};

const ColorButton = withStyles(theme => ({
    root: {
        backgroundColor: '#f2726f',
        '&:hover': {
            backgroundColor: '#f2726f',
        },
    },
}))(Button);

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
        marginTop: theme.spacing(20),
        marginBottom: theme.spacing(10),
    },
    background: {
        background: '#29c3be',
        marginTop: theme.spacing(10),
        paddingBottom: theme.spacing(30),
    },
    imgDog: {
        position: 'absolute',
        zIndex: 50,
    },
    imgBlob: {
        position: 'absolute',
        zIndex: 10,
        paddingLeft: theme.spacing(6),
    },
    marginHeaderGrid: {
        marginTop: theme.spacing(10),
        color: '#fff',
    },
    marginHeaderTypography: {
        paddingTop: 3,
    },
    typography: {
        paddingTop: theme.spacing(3),
        color: '#fff',
    },
    typographyGrid: {
        paddingTop: theme.spacing(10),
        color: '#fff',
    },
    typographySubtitle: {
        color: '#5d',
    },
}));

function Impact() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Grid
                container
                justify="flex-start"
                alignItems="flex-start"
            >
                <Grid item sm={7}>
                </Grid>
                <Grid item sm={5}>
                    <img src={require('../images/littleDog.png')} className={classes.imgDog}/>
                </Grid>
            </Grid>
            <div className={classes.background}>
                <Container maxWidth="lg">
                <Grid
                    container
                    justify="flex-start"
                    alignItems="flex-start"
                >
                    <Grid item sm={6}>
                        <Grid
                            container
                            justify="flex-start"
                            alignItems="flex-start"
                            className={classes.marginHeaderGrid}
                        >
                            <Grid item sm={0}>
                                <HeaderIcon fontSize="large"/>
                            </Grid>
                            <Grid item sm={10}>
                                <Typography variant="h6" className={classes.marginHeaderTypography}>
                                    OUR IMPACT
                                </Typography>
                            </Grid>
                        </Grid>
                        <Typography component="div">
                            <Box fontSize="h3.fontSize" fontWeight="fontWeightBold" className={classes.typography}>
                                Nemo enim ipsam voluptatem quia voluptas
                            </Box>
                        </Typography>
                    </Grid>
                    <Grid item sm={6}>
                        <img src={require('../images/Blob 4.png')} className={classes.imgBlob}/>
                    </Grid>
                </Grid>
                <Grid
                    container
                    justify="flex-start"
                    alignItems="flex-start"
                >
                    <Grid item sm={1}>
                        <img src={require('../images/dog_duckling.png')} />
                    </Grid>
                    <Grid item sm={2}>
                        <Typography component="div">
                            <Box fontSize="h3.fontSize" fontWeight="fontWeightBold" className={classes.typography}>
                                3,700
                            </Box>
                        </Typography>
                        <Typography variant="subtitle1">
                            puppy baths
                        </Typography>
                    </Grid>
                </Grid>
                </Container>
            </div>
        </div>
    )
}

export default Impact;
